import React from 'react'
import { connect } from 'react-redux'
import * as qActions from '../../reducer/query/actions'
import * as uActions from '../../reducer/user/actions'

interface Item {
  userItem: __esri.PortalItem
}

interface ItemProps {
  userItems: Item[],
}

export class QueryTable extends React.Component <ItemProps, any> {

  public static defaultProps = {
    userItems: undefined,
  }

  render() {
    return (
      <div className="queryTable">
        <table>
          <thead>
            <th>item</th><th>created</th><th>tags</th><th>...</th>
          </thead>
          <tbody>
            {this.props.userItems.map((userItems,index) => (
            <tr key={index}><td>${userItems.userItem.id}</td></tr>
            ))}
          </tbody>
        </table>
      </div>
    )
  }
}

const mapStateToProps = ({ user: { userItems }}:any) => ({
  userItems,
})
//const mapDispatchToProps = (dispatch:any) => { }

export default connect(mapStateToProps, )(QueryTable)
